import React from 'react';
import PropTypes from 'prop-types';

import { Card } from 'react-bootstrap';

const styles = {};

export default function ProfileCard(props) {
  const { member } = props;
  return (
    <Card>
      <Card.Img variant="top" src={member.photoURL} />
      <Card.Body>
        <Card.Title>{member.name}</Card.Title>
        <Card.Text>{member.role}</Card.Text>
        <Card.Text>{member.bio}</Card.Text>
        <Card.Text>Commits: {member.commitCount}</Card.Text>
        <Card.Text>Issues: {member.issueCount}</Card.Text>
        <Card.Text>Unit Tests: {member.testCount}</Card.Text>
      </Card.Body>
    </Card>
  );
}

ProfileCard.propTypes = {
  member: PropTypes.shape({
    photoURL: PropTypes.string.isRequired,
    name: PropTypes.string.isRequired,
    role: PropTypes.string.isRequired,
    bio: PropTypes.string.isRequired,
    commitCount: PropTypes.number.isRequired,
    issueCount: PropTypes.number.isRequired,
    testCount: PropTypes.number.isRequired,
  }),
};
